<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>kentan - This small framework has the goal to provide a more efficient way to generate test data.</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="This small framework has the goal to provide a more efficient way to generate test data.">
  <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
  <link rel="stylesheet" href="//unpkg.com/docsify/lib/themes/vue.css">
</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
      name: 'kentan',
      repo: 'https://github.com/GregOnNet/kentan',
      loadSidebar: true,
      coverpage: true
    }
  </script>
  <script src="//unpkg.com/docsify/lib/docsify.min.js"></script>
</body>
</html>
